"use strict";Bridge.define("ClientTestLibrary.Linq.TestLinqGenerationOperators",{statics:{test:function(assert){var numbers,numbersExpected,repeatNumbers,repeatNumbersExpected;assert.expect(2);numbers=Bridge.Linq.Enumerable.range(0,6).select(function(n){return{number:n,isOdd:n%2==1}}).toArray();numbersExpected=[{number:0,isOdd:!1},{number:1,isOdd:!0},{number:2,isOdd:!1},{number:3,isOdd:!0},{number:4,isOdd:!1},{number:5,isOdd:!0}];assert.deepEqual(numbers,numbersExpected,"Range() 6 items from 0");repeatNumbers=Bridge.Linq.Enumerable.repeat(-3,4).toArray();repeatNumbersExpected=[-3,-3,-3,-3];assert.deepEqual(repeatNumbers,repeatNumbersExpected,"Repeat() -3 four times")}}});Bridge.init();